import React from "react";
import prod1 from "./sec2Produc1.avif";
import "./SectionThird.css";

const data = [
  {
    id: 1,
    img: src/components/Sections/SectionThird/sec2Produc1.avif,
    head: "Eleos Aromatique Hand Balm",
    para: "Offers rich hydration for weather-wearied hands",
  },
  {
    id: 2,
    img: "",
    head: "",
    para: "",
  },
  {
    id: 3,
    img: "",
    head: "",
    para: "",
  },
  {
    id: 4,
    img: "",
    head: "",
    para: "",
  },
  {
    id: 5,
    img: "",
    head: "",
    para: "",
  },
  {
    id: 6,
    img: "",
    head: "",
    para: "",
  },
];

function SectionThird() {
  return (
    <div className="SectionThird">
      {data.map((x) => {
        return (
          <div className="product1">
            <img src={x.img} alt="" />
            <h4>{x.head}</h4>
            <p>{x.para}</p>
          </div>
        );
      })}
    </div>
  );
}

export default SectionThird;
